import React, { useEffect } from 'react'
import { useSelector } from 'react-redux'

export default function History() {
    const history = useSelector(state => state.money.history)
    useEffect(() => {
        console.log(history)
    }, [history])

  return (
    <div>
        {history.map(el => 
            <div className='history-block'>
                
            </div>
        )}
    </div>
  )
}
